sections.code:
body {
    font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Helvetica, Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol"
}
.markup h1,
.markup h2 {
    margin: 30px 0 20px 0;
    color: #444;
}
.markup code {
    border-radius: 0;
    border: 0;
}
.markup-content {
    color: #777
}
.markup h3,
.markup h4,
.markup h5,
.markup h6 {
    font-weight: 500;
    color: #707070;
}
.content-view .CodeMirror pre {
    font-family: Menlo;
    font-size: 12px;
}
pre code {
    font-family: Menlo;
    font-size: 12px;
}

* {
    font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Helvetica, Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol";
    background-color: #f8f9fa;
    color: #212529;
}
pre {
    font-family: Menlo !important;
    font-size: 12px;
}
#jenkins-name-icon {
    display: none
}
#tasks .task {
    font-size: 12px;
}
a.task-icon-link {
    display: none;
}
a:link {
    color: #adb5bd;
}
a:visited {
    color: #868e96;
}
.pane-header {
    border-top: none;
    border-top-left-radius: 0;
    border-top-right-radius: 0;
}
.pane-header,
.pane-footer {
    background-color: transparent;
    border: none;
    border-left: none;
    border-right: none;
    color: #3b5bdb;
}
#header {
    background-color: transparent;
    margin-top: 20px;
}
#search-box {
    background: #f1f3f5;
    height: 24px;
    padding-left: 20px;
    width: 15em;
    position: static;
    border: 0;
    border-radius: 0;
    box-shadow: none;
    outline: none;
}
.icon-help.icon-sm {
    display: none;
}
.login a b,
.middle-align td,
td.middle-align {
    font-weight: normal;
}
#breadcrumbs LI A:link,
#breadcrumbs LI A:visited {
    color: #3b5bdb;
}
#breadcrumbs {
    border: none !important;
}
table.pane {
    border: 0;
}
#side-panel .pane-frame:hover,
#side-panel .pane-frame.mouseover {
    border: 0;
}
